(2, 2, 'Worksite Advisory', 'AFP PROVIDA', 5, '2012-01-02', '2020-08-11', '•	Responsable de la administración de cartera empresa (actualización y mantención de datos de contacto empleador, entrega de información constante y oportuna)\r\n•	Responsable de la presentación del proyecto de educación y asesoría previsional al empleador y al mismo tiempo de la coordinación de actividades a realizarse al interior de la empresa.\r\n•	Encargada de crear espacio de fidelización en las empresas VIP, planificando y coordinando agendas manteniendo la marca, con el fin de llegar al afiliado ofreciendo un servicio personalizado.\r\n•	Realización de charlas informativas, educativas y de asesorías previsional, en dependencias de la empresa, sean estás masivas o personales.', 'Posicionar el programa como un servicio integrado al área comercial.\r\n\r\nA través de la retención y fidelización se logró retener las cuentas empresas principales de la Cia., incorporación de nuevas cuentas, apoya al área comercial y capacitación a los ejecutivos comerciales.\r\n \r\nSe implementaron Módulos de Atención Empresa, con el fin de conseguir actualización de antecedentes (afiliados), entrega de claves de acceso para el ingreso al sitio Web PROVIDA AFP, oferta y apertura de cuentas de productos voluntarios, entrega de certificados y simulación pensión, entre otros', '2020-04-16 02:08:49', '2020-07-08 01:44:15'),
