(34, 47, 'Gerente de Ventas', 'Cemento Polpaico', 29, '2017-11-20', '2019-12-31', 'CEMENTO POLPAICO S.A.	2017 - 2019\r\nEmpresa líder en Chile con producción y venta de Cemento, Hormigones y Áridos\r\n\r\nAsesor Gerencia Comercial	2019\r\nEncargado de prestar asesoría al Gerente Comercial. \r\n•	Elabora informes de gestión del equipo de ventas.\r\n•	Realiza análisis de volúmenes, precios, márgenes y Ebitda de los actuales clientes y prospectos. \r\n•	Cumple con plan propuesto, entregando sugerencias de experto. \r\n\r\nGerente de Ventas Regiones 	2017-2019\r\nResponsable de las ventas de cemento en el país, a través de Distribuidores y venta directa.\r\n•	Asegura el logro de los principales KPI del área: volumen, precios, márgenes y Ebitda. \r\n•	Dirige un equipo de ventas, con 16 ejecutivos y presencia nacional.\r\n•	Participa en cierre de grandes negocios en el país.', 'Contrata nuevos ejecutivos para dar cobertura en todo el país.	\r\nCumple con el plan, aumentando en 10% las Ventas y 5% Margen de la compañía.', '2020-06-06 22:05:48', '2020-06-06 22:47:04'),
(35, 47, 'Gerente de Ventas', 'MELON S.A.', 29, '1997-09-01', '2017-11-10', 'Gerente de Ventas Regiones 	2012 - 2017\r\n   Responsable de las ventas de cemento en el país, a través de Distribuidores y venta directa.\r\n•	Asegura el logro de los principales KPI del área: volumen, precios, márgenes y Ebitda. \r\n•	Dirige un equipo de ventas, con 9 ejecutivos y presencia nacional.\r\n•	Participa en cierre de grandes negocios en el país.\r\n•	Consolida un equipo de ventas, con ejecutivos de alto impacto en el país.\r\n\r\nSubgerente de Ventas Zona Norte 	        2011\r\n   Responsable de las ventas de cemento en la I,II,III,IV y V región.\r\n\r\nSubgerente de Ventas Zona Centro Sur	2007-2010\r\n   Responsable de las ventas de cemento en la V, VI y VII región.\r\n\r\nJefe de Negocios V Región	1997-2006\r\n   Responsable de las ventas de cemento en la V región, a través de Distribuidores y venta directa.', 'Consolida un equipo de ventas, con ejecutivos de alto impacto en el país.\r\nLogro sistemático, durante 20 años de logros en el área con número de clientes, ventas, precios, márgenes, ebitda, en difrentes regiones del país.', '2020-06-06 22:43:21', '2020-06-06 22:44:55'),
