(37, 47, 'Supervisor de Operaciones - Ingeniero de Estudios', 'Shell Chile SACI', 83, '1993-03-01', '1996-09-30', 'Supervisor de Distribución Planta Las Salinas, V Región		1995\r\n   Responsable de la operación de combustibles y lubricantes.\r\n•	Dirige un equipo de 10 personas, con 7 operadores de bodega y 3 administradores.\r\n\r\nIngeniero de Estudios	1993-1994\r\n   Responsable de la elaboración de los estudios en la Gerencia de Operaciones.', 'Equipo de trabajo alineado y con buen clima laboral', '2020-06-06 23:02:52', '2020-06-06 23:02:52'),
