INSERT INTO `ofertas` (`id`, `user_id`, `industria`, `cargo`, `lugar`, `jornada`, `ciudad`, `descripcion`, `excluyentes`, `deseables`, `renta_fija`, `renta_variable`, `bonos`, `beneficios`, `porque`, `estado`, `created_at`, `updated_at`) VALUES
(1, 3, 110, 'REPRESENTANTE DE VENTAS', 'Ambas', 'Full Time', 'SANTIAGO', 'Responsable de la venta de los servicios de la compañía a clientes empresas con necesidades importación y/o exportación de insumos o producto.Dedicado al cierre de negocios relativos a los servicios de la empresa como agente de carga. - Confección de propuesta de negocio para clientes, definiendo y acordando INCOTERM y los servicios incluidos en dicha propuesta, según las necesidades de transporte de carga del cliente y el margen de utilidad (profit) para la empresa. - Administración de cartera de clientes empresas e incremento en el volumen de venta con ellos (importaciones/exportaciones). - Prospección y obtención de nuevos clientes empresas con envíos de carga, ya sean importaciones o exportaciones. - Registro efectivo de actividades y resultados en el sistema de gestión dispuesto para tales fines. - Potenciar traficos primarios y hacer campañas comerciales para productos específicos instruidos por la gerencia comercial.', 'Nivel de inglés intermedio Cartera de clientes activa  Estudios Técnico o Superior, afín al cargo Movilización propia PC y aplicaciones MS Office al menos a nivel de usuario', '2 a 3 años en el cargo, 6 años en la industria. Los años de experiencia en el cargo o en la industria pueden ser flexibles, solamente en caso de que el candidato tenga un excelente perfil comercial.', '1.000.000', '0', 'ANUALES', 'se trabaja 40 hrs semanales , estacionamiento y bono movil', 'Somos una empresa en crecimiento y desarrollo , donde podras desarrollarte y crecer en el área comercial.', 1, '2020-04-16 04:09:26', '2020-04-16 04:09:26'),
(2, 66, 71, 'Técnicos Paramédicos - Personal de refuerzo por Contingencia Sanitariaa', 'Oficina', 'Full Time', 'OVALLE', 'Perfil del Cargo\r\nFormación Educacional\r\nTítulo de Técnico de Nivel Superior otorgado por un Establecimiento de Educación Superior del Estado o reconocido por éste; o, Título de Técnico de Nivel Medio o equivalente otorgado por el Ministerio de Educación; o, Licencia de Enseñanza Media o equivalente y certificado de competencias para ejercer como auxiliar paramédico otorgado por la Autoridad Sanitaria, previa aprobación del curso de 1.500 horas como mínimo, según programa del Ministerio de Salud.\r\nEntregar cuidados de enfermería asignados a su rol, según el plan de atención programado por enfermeros, aplicando protocolos de calidad y seguridad en la atención a los pacientes a su cargo, bajo un modelo con enfoque humanizado e integral, utilizando eficientemente los recursos disponibles del CASR.', 'Los postulantes deben enviar sus docuementos de postulación \r\nDocumentos requeridos para postular\r\n- Currículum actualizado.\r\n- Copia de certificado que acredite nivel Educacional, requerido por ley.\r\n- Certificado de registro en la Superintendencia de Salud. \r\n\r\nCalendarización del Proceso\r\nFase	Fechas\r\nPostulación\r\nDifusión y Plazo de Postulación	16/06/2020-24/06/2020\r\nSelección\r\nProceso de Evaluación y Selección del Postulante	25/06/2020-02/07/2020\r\nFinalización\r\nFinalización del Proceso	03/07/2020-09/07/2020', 'Especialización y/o Capacitación\r\nDeseable Curso IAAS.\r\nDeseable Curso RCP.\r\n Otros.\r\nSalud compatible con el cargo.\r\n Experiencia sector público / sector privado\r\nDeseable experiencia clínica en Unidad de Paciente Crítico y/o Urgencia en instituciones de salud pública y/o privada.', '636.000', '0', '0', '0', '0', 1, '2020-06-24 02:42:10', '2020-06-24 02:42:10'),
(3, 66, 71, 'enfermera', 'Oficina', 'Temporada', 'OVALLE', 'Se requiere enfermera para Administrar, coordinar y controlar los recursos físicos, humanos y materiales existentes en las unidades de UPC Adulto, con el fin de asegurar su funcionamiento, logrando una atención del usuario bajo los estándares de calidad, acorde a los lineamientos de la organización', 'Título de Enfermería Universitaria, obtenido en universidad acreditada.\r\nAl menos 1 año de experiencia en UCI, UPC\r\nDisponible para 4to turno', 'Esten dispuestos a cambiar de región', '1.500.000', '0', '.', '.', '- Contrato de trabajo directo.\r\n\r\n-        Renta acorde al mercado\r\n\r\n-          Horario: 4turno\r\n\r\n-', 1, '2020-06-24 08:22:59', '2020-06-24 08:22:59');
INSERT INTO `oferta_ops` (`id`, `user_id`, `industria`, `cargo`, `tipo_licencia`, `experiencia`, `lugar`, `zona`, `ciudad`, `jornada`, `descripcion`, `detalles`, `excluyentes`, `deseables`, `otros`, `renta_fija`, `renta_variable`, `bonos`, `estado`, `created_at`, `updated_at`) VALUES
(1, 13, 69, 'ENCARGADO DE PROCESOS DE PRODUCCIÓN', '0', '2', 'Oficina', 'Metropilitana', 'SANTIAGO', 'Full Time', 'Importante empresa manufacturera requiere \r\nEncargado de procesos productivos Con experiencia comprobable en producción de ropa a gran escala.\r\nConocimientos en moldes y corte de ropa,manejo de maquinas rectas y overlock.\r\nDe buen trato y capaz de manejar equipos de personas.\r\nPostular solo Interesados y que cumplan con los requisitos .', 'Experiencia en la industria manufacturera de lo menos 2 años . Producción a gran escala de un solo producto (prenda vestuario)\r\nSupervisar de maquinaria\r\nSupervisar de personal cargo', 'Minino 2 años de experiencia comprobable en el cargo , tanto en linea de producción  a gran escala como a cargo de equipos de trabajo en la  linea de producción .\r\nConocimientos en molde,corte de ropa, manejo de maquinas  de coser linea recta y overlok.', '.', '.', '?', '?', '?', 1, '2020-07-01 02:46:21', '2020-07-01 02:46:21');
