(104, 169, 'aCzxt8fYay4ftotpLHfMMmtejUCikTWK2WQG8OdR.jpeg', 'juan manuel cid saldías', 1069, 'juancid_267@outlook.cl', '16-05-1987', '0', '953273168', 'Los Mirlos 3881', 86, '0', 1, 7, 7, 'Soy titulado de Técnico Nivel Superior En Redes y Telecomunicaciones, me desempeñe como soporte nivel computacional por 4 años,al tiempo descubrí que lo que me gustaba era el área comercial por ende me puse a estudiar administración de empresas financieras,la cual tuve que congelar.', '1', '1.000.000', 'Asesor Comercial,ventas de productos Fijos e intangibles.', 'Tengo una filosofía de trabajo la cual consta de que que me gusta que me paguen a base de resultados y no base a cumplir un horario,por eso me interesa los puesto de ventas o asesoría porque creo y siento,que uno ocupa mas sus propias habilidades y conocimiento que he ido adquiriendo ,ya que soy super autónomo y autodidacta,creo en la auto educación y en el constanste aprendizaj.', NULL, NULL, NULL, '2020-07-02 03:08:24', '2020-07-02 03:18:11'),
