(106, 177, 'TGkjZADVMVv5hfYJoqDbZF18ArenBWyIHomk9xOZ.jpeg', 'Richard jose Femayor medina', 1094, 'Richard.femayor2015@gmail.com', 'Nov 26, 1990', '0', '973522087', 'Santa aida 6041', 121, '0', 1, 7, 7, 'Soy una persona con alto sentido de la responsabilidad, analítica, creativa y dinámica con facilidad de adaptación y capacidad de trabajar en equipo en condiciones de alta presión, con iniciativa para resolver problemas de manera eficiente, para lograr los objetivos y metas trazados por la empresa. Además, me considero una persona comunicativa, con capacidad de liderazgo y de aprender rápidamente con motivación. Mis fortalezas operacionales están en áreas tales como: Control de inventario e ubicación del material, Recepción y de Despacho, manejo de indicadores, control logístico y transporte, manejo de Montacargas y Transpaleta eléctrica, Manejo y control de personal, Manejo y control de químicos. Sin dejar de lado mis fortalezas administrativas y de control en programas como SAP, Excel (Intermedio-Avanzado), Oracle entre otros.', '2', '500', 'Encargado de Bodega de distribución de gas licuado', 'Soy persona proactiva, responsable con ganas de trabajar. Apuntando a los objetivos de la empresa dando de todo mi conocimiento a la organización.', NULL, NULL, NULL, '2020-07-02 20:18:03', '2020-07-02 20:29:21'),
(107, 180, 'ccffNuKyTV2oHYJzSDjxHCwdpc8U4qnTaZDyaPCv.jpeg', 'Gustavo Vivanco Martínez', 433, 'vivanco.gustavo@gmail.com', 'Jul 28, 1974', '0', '+56935785160', 'Salesianos 1190', 124, '2', 0, 1, 7, 'Durante mi vida de pregrado, grado y postgrado, me he desarrollado laboralmente como un colaborador feliz. \r\n\r\nDiciembre 2019 – enero 2014, Konectiva S.A, Santiago.\r\nLos últimos cinco años y con el mismo ahínco, he trabajado como responsable Comercial Operaciones y Calidad en una empresa de Ingeniería mecánica para la industria de alimentos, química, minera y salud.\r\nDiciembre 2013 – enero 2002, Air Liquide Chile S.A, País.\r\nAnteriormente trabajé doce años en una compañía internacional de productos químicos para la industria de, alimentos, minería, médica y metalurgia, teniendo un desarrollo de carrera coherente, desafiante y ascendente. \r\n\r\nDiciembre 2000 – marzo 1995, INACAP - USACH - U. DE CHILE, Santiago.\r\nEn mi etapa académica trabajé cinco años como ayudante de cátedra y laboratorio. \r\n\r\nCapacidades\r\n\r\n•	Capacidad para enfocarse en crear valor en línea con los objetivos corporativos.\r\n•	Capacidad para movilizar equipos construyendo relaciones efectivas con diferentes áreas de la compañía.\r\n•	C', '2', '1.000.000', 'Comercial - Operaciones - Calidad', 'Motivación, proactividad, compromiso y ganas de aprender y emprender desafíos.', '2', '2', 'an6QPEQ71FcM8kojYdhBeWTMPIjprLJ8lY1XXeyK.pdf', '2020-07-05 06:30:42', '2020-07-05 06:56:25'),
(108, 181, 'BBIiqYqMei9RhEOvFGBgBjsXAIjLjQ6jpGgaZP97.jpeg', 'Yenithsa Nathaly Caldera Vasquez', 373, 'Yenithsa@gmail.com', 'Nov 14, 1988', '1', '+56982651360', 'Avenida Boulevard San Pedro 900 Casa 45', 83, '1', 1, 6, 7, 'Con dos años de experiencia como Supervisora en la Industria Metalmecánica en general, con énfasis en el área de Logística y Despacho y Líneas de Producción, operaria de producción, ventas, atención al cliente, inventarios y \r\nmanejo de personal, trabajo en terreno en turnos rotativos. Con conocimientos de control de calidad, office, con interés en la formación continua, Responsable y comprometida con el logro de metas con marcadas habilidades para trabajar en equipo, en cualquier horario, bajo presión y según órdenes establecidas. Disponibilidad inmediata.', '2', '600.000', 'Experiencia en supervision, atención al cliente, operaria de producción, Control de calidad.', 'Tengo todos los conocimientos y actitudes para llevar a cabo el trabajo solicitado, me considero una personas responsable y comprometida con el trabajo, soy proactiva, busco siempre los mejores resultados posibles para los objetivos planteados, formó un buen ambiente laboral, me gusta trabajar en equipo y siempre con ganas de aprender y aportar en pro del trabajo.', '2', '2', 'ALuS73zaytBkf8BU7INaxxAaBYF4dka1h6dSLTs8.pdf', '2020-07-06 17:45:14', '2020-07-06 18:22:24'),
