(120, 197, 'WVX8ws0e2jNqGh0fNFmPpgSx0lO0yQvqU4CY0Ffj.png', 'Yannina Farias Llop', 816, 'yanyllop@yahoo.com', 'Nov 20, 1984', '1', '56966326335', 'Apoquindo 6797', 109, '0', 0, 6, 3, 'Periodista titulada de la Pontificia Universidad Católica, con 10 años de trayectoria. Experiencia como encargada de comunicaciones corporativas (internas y externas), asesora en marketing digital, ejecutiva de cuentas, editora/redactora de contenidos y jefe de proyectos en áreas Comunicaciones, Comercial- Marketing, Recursos Humanos, Capacitaciones y Gestión de Datos para empresas rubros financiero, tecnología, ingeniería, construcción, minería, energía, medioambiente, venta B2B e instituciones estatales. Desarrollo de planes/campañas de comunicación foco 360º (com. interna, externa y marketing). Elaboración de contenidos medios internos (mailing, intranet, revistas, newsletter, videos) y externos (prensa, publirreportajes, avisos, web y RRSS). Líder implementación y administración nuevos medios (web, intranet, Teams, RRSS). Planes de marketing digital; contenidos, administración y monitoreo RRSS corporativas y embajadores de marca.', '1', '$1.200.000', 'Encargada de Comunicaciones Internas Área Gestión de Datos Transbank', 'Porque poseo las competencias profesionales y personales para desempeñar con éxito funciones en comunicaciones corporativas y marketing digital, desempeñando roles como encargada/ responsable de áreas y proyectos, asesora, ejecutiva de cuentas y redactora/ editora de contenidos en comunicaciones internas y externas, marketing digital. Amplio conocimiento de variados rubros.', '2', '2', 'd5CvYd1W6GTMtSMzIYX4x1QclyjwMsZLxjP9d8l5.pdf', '2020-07-23 23:24:50', '2020-07-23 23:35:07'),
(121, 200, 'V6WMZrgz6i03yhxoV0J8Ji41TqZRP2t4WEBXPdv2.jpeg', 'alex rodrigo muñoz chamorro', 473, 'alexr.munoz@gmail.com', 'Ene 15, 2020', '0', '56957098128', 'alcalde pedro alarcon 1037 depto 1505.B', 124, '2', 3, 2, 2, 'Cuento con una amplia trayectoria en el área de Tecnología de la Comunicación, experiencia en el diseño soluciones de valor agregado, sistemas de atención a clientes, integración de tecnologías, asesorando a clientes en la adopción de herramientas en la nube, orientado a la optimización de procesos y costos, entregando soluciones basadas en la mejor tecnología para cada caso de uso.\r\nAmplios conocimientos, en áreas de Telecomunicaciones (Alcatel-Lucent, Audiocodes, Mitel,) , soluciones de Contact Center (Genesys Cloud y Genesys Engage), y desarrollo de proyectos de integración, CRM, Cloud, Chatbot, soluciones analíticas y soluciones de IA, aplicadas a procesos de negocios.\r\nEn el último tiempo, trabajando fuertemente en entregar apoyo a clientes en el desarrollo de soluciones Cloud, con los principales proveedores de nubes públicas, como son Huawei, AWS, Azure, GCP. Fuertemente orientado al trabajo en equipo y por objetivos; apasionado por la tecnología.', '2', '1.700.000', 'Trabajaba en el área de venta de servicios Cloud administrados, en distintas nubes públicas.', 'Porque soy una persona muy comprometida en mi trabajo, tengo bastante experiencia en entender los problemas que pueden tener los clientes en distintos ámbitos del negocio, para buscar la mejor solución costo / beneficio.', '2', '2', 'EpzZMljtNYrQYmXlYW7z9I7tl3UuLH1qxEdCvHyX.pdf', '2020-08-01 20:22:29', '2020-08-05 05:56:27');
